/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import Dune from "../images/dune.jpg";
import React from "react";
import "./home.scss";
import CircleButton from "../components/CircleButton";
import ReactPageScroller from "react-page-scroller";
import AboutPage from "./About"

const tablet = `@media (max-width: 800px)`;
const mobile = `@media (max-width: 500px)`;

const HomeBackground = styled.div`
  background: url(${Dune}) no-repeat center center fixed;
  background-size: cover;
  height: 100%;
  font-size: 24px;
  color: white;
  font-weight: bold;
  bottom: 0;
`;

const HomeDiv = styled.div`
  top: 350px;
  width: 250px;
  font-size: 40px;
  padding: 10px;
  border-style: solid;
  border-width: 2px;
  border-color: #aeff00;
  z-index: 4000;
  left: 200px;
  position: relative;
`;

const DuneImg = styled.img`
  width: 80%;
  right: 100px;
  position: absolute;
  border-right: 6px solid #aeff00;
  border-bottom: 6px solid #aeff00;
  ${tablet} {
    padding: 60px 40px;
  }
  ${mobile} {
    padding: 80px 0 80px 130px;
  }
`;

const Figure = styled.p`
  position: relative;
  z-index: 4000;
  left: 1300px;
  top: 700px;
	font-family: good-times, sans-serif;
`;

function Home() {
  return (
    <HomeBackground>
        <Nav />
        <ReactPageScroller animationTimer={700}>
          <div>
        <HomeDiv> JOHN SCHRIEMER </HomeDiv>
        <DuneImg src={Dune} />
        <Figure>Fig 1. Dunes</Figure>
        </div>
        <div>
          <AboutPage/>
        </div>
        </ReactPageScroller>
        <CircleButton />
    </HomeBackground>
  );
}

export default Home;
